iccoefmodel <- function(numimage,ncovar,covar1,covar2=NA) {
  if(ncovar==1){
  # Bébés 3 mois
  ppm_3m_Im <- ppm(X_baby3month_Im[[numimage]]~covar,covariates=list(covar=covar1[[numimage]]))
  # Bébés 6 mois
  ppm_6m_Im <- ppm(X_baby6month_Im[[numimage]]~covar,covariates=list(covar=covar1[[numimage]]))
  # Bébés 9 mois
  ppm_9m_Im <- ppm(X_baby9month_Im[[numimage]]~covar,covariates=list(covar=covar1[[numimage]]))
  # Bébés 12 mois
  ppm_12m_Im <- ppm(X_baby12month_Im[[numimage]]~covar,covariates=list(covar=covar1[[numimage]]))
  # Adultes
  ppm_ad_Im <- ppm(X_adult_Im[[numimage]]~covar,covariates=list(covar=covar1[[numimage]]))

  # Coefficients estimés
  beta0 <- c(summary(ppm_3m_Im)$coefs.SE.CI$Estimate[1], summary(ppm_6m_Im)$coefs.SE.CI$Estimate[1], summary(ppm_9m_Im)$coefs.SE.CI$Estimate[1], summary(ppm_12m_Im)$coefs.SE.CI$Estimate[1], summary(ppm_ad_Im)$coefs.SE.CI$Estimate[1])
  beta1 <- c(summary(ppm_3m_Im)$coefs.SE.CI$Estimate[2], summary(ppm_6m_Im)$coefs.SE.CI$Estimate[2], summary(ppm_9m_Im)$coefs.SE.CI$Estimate[2], summary(ppm_12m_Im)$coefs.SE.CI$Estimate[2], summary(ppm_ad_Im)$coefs.SE.CI$Estimate[2])
  
  # Intervalle de confiance
  CI.lo.beta0  <- c(summary(ppm_3m_Im)$coefs.SE.CI$CI95.lo[1],summary(ppm_6m_Im)$coefs.SE.CI$CI95.lo[1],summary(ppm_9m_Im)$coefs.SE.CI$CI95.lo[1],summary(ppm_12m_Im)$coefs.SE.CI$CI95.lo[1],summary(ppm_ad_Im)$coefs.SE.CI$CI95.lo[1])
  CI.lo.beta1  <- c(summary(ppm_3m_Im)$coefs.SE.CI$CI95.lo[2],summary(ppm_6m_Im)$coefs.SE.CI$CI95.lo[2],summary(ppm_9m_Im)$coefs.SE.CI$CI95.lo[2],summary(ppm_12m_Im)$coefs.SE.CI$CI95.lo[2],summary(ppm_ad_Im)$coefs.SE.CI$CI95.lo[2])
  
  CI.hi.beta0 <- c(summary(ppm_3m_Im)$coefs.SE.CI$CI95.hi[1],summary(ppm_6m_Im)$coefs.SE.CI$CI95.hi[1],summary(ppm_9m_Im)$coefs.SE.CI$CI95.hi[1],summary(ppm_12m_Im)$coefs.SE.CI$CI95.hi[1],summary(ppm_ad_Im)$coefs.SE.CI$CI95.hi[1])
  CI.hi.beta1 <- c(summary(ppm_3m_Im)$coefs.SE.CI$CI95.hi[2],summary(ppm_6m_Im)$coefs.SE.CI$CI95.hi[2],summary(ppm_9m_Im)$coefs.SE.CI$CI95.hi[2],summary(ppm_12m_Im)$coefs.SE.CI$CI95.hi[2],summary(ppm_ad_Im)$coefs.SE.CI$CI95.hi[2])
  
  # Tracer IC
  par(mfrow=c(1,2))
  x <- 1:5
  #Trace IC b0
  # x=c("3mois","6mois","9mois","12mois","adultes")
  plotCI(x, beta0, ui=CI.hi.beta0, li=CI.lo.beta0, lwd=2,col="red",scol="blue", main=paste("IC Plot, Beta 0, Image",numimage), xaxt="n")
