### On regroupe les bébés 3 mois et 6 mois d'une part et 9 mois et 12 mois d'autre part
# Sans saillance, intercept commun
iccoefmodel.int1 <- function(numimage,covar) {
  # Image 1
  if(numimage==1){
    if(covar==1) {
      fit.dist1=mppm(ppp~Density35bin*groupe1-Density35bin-groupe1, data=subset(hyp.glob[(hyp.glob$groupe1=="Baby3/6month" | hyp.glob$groupe1=="Baby9/12month") & hyp.glob$image=="Image1"],npoints(ppp)>0))# Coefficients estimés
